            <div className="header">

                <div className="logo">

                </div>
                <ul class="nav justify-content-end nav-custom  ">
                    <li class="nav-item">
                    <Link to={'/'}> <a class="nav-link" href="#">Home</a></Link>
                    </li>
                    <li class="nav-item">
                       <Link to={'/Reservation'}> <a class="nav-link" href="#">Reservation</a></Link>
                    </li>
                    <li class="nav-item">
